import React, { useState} from "react";
impor
const Table = ({ cards }) => {
  return (
    <div>
      <table border='1'>
        <tr>
          <th>N/N</th>
          <th>Name</th>
          <th>Price</th>
          <th>Speed</th>
          <th>Buttons</th>
        </tr>
        {cards.map((card) => {
          return <TableRow rowData={card} key={card.id} />;
        })}
      </table>
    </div>
  );
};

export default Table;



const CardWrapper=()=>{

  
  return(
    <>
    <button>Next</button>
    <Card />
    <button>Previous</button>
    
    </>
  )
}




const Card =({english})=>{
  return(
    <div>{english}</div>
  )
}
